function interpolateColors(r,e,t){let n=[],a=r.replace(/[^\d,]/g,"").split(","),p=e.replace(/[^\d,]/g,"").split(","),s=1/(t-1),I=0;for(let r=0;r<t;r++)n.push("rgb("+Math.round(parseInt(a[0])+I*(parseInt(p[0])-parseInt(a[0])))+", "+Math.round(parseInt(a[1])+I*(parseInt(p[1])-parseInt(a[1])))+", "+Math.round(parseInt(a[2])+I*(parseInt(p[2])-parseInt(a[2])))+")"),I+=s;return n.reverse()}